import React from 'react';

function Nav() {
  return (
    <nav className="flex justify-center items-center h-14 bg-white shadow-md">
      <ul className="flex space-x-8 text-lg font-lt">
        <li className="hover:text-blue-500 cursor-pointer">
          <a href="#about">about</a>
        </li>
        <li className="hover:text-blue-500 cursor-pointer">
          <a href="#projects">projects</a>
        </li>
        <li className="hover:text-blue-500 cursor-pointer">
          <a href="#experience">experience</a>
        </li>
        <li className="hover:text-blue-500 cursor-pointer">
          <a href="#fun">fun</a>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
